records.addlTxt:
Defendant Nathaniel Anthony Woods in court with attorney Awni M Yasin.  Randy P. Sitzberger appeared for the State of Wisconsin.  Deputy court clerk cmt.

Sentencing proceeds. Statements made by the State, defense and defendant. 

AS TO COUNT 3:  The Court sentenced defendant to serve a term of IMPRISONMENT in the Wisconsin State Prisons for 3 1/2 YEARS.  INITIAL CONFINEMENT of 1 1/2 YEARS and EXTENDED SUPERVISION of 2 YEARS with 197 days credit. Defendant is eligible for Challenge Incarceration Program.  Defendant is eligible for the Wisconsin Substance Abuse Program.

Conditions of Extended Supervision:
-AODA assessment and cooperate with any programs deemed necessary by the probation department;
-absolute sobriety, no alcohol, no drugs;
-no possession/consumption/selling/being in the vicinity of illegal drugs/alcohol;
-random urine screens, if deemed appropriate;
-treatment and/or counseling as determined by agent;
-seek/maintain fulltime verifiable employment/education/vocation;
-provide DNA sample if one has not previously been provided;
-pay DNA surcharge, if not already paid, failure to pay results in a civil judgment;
-pay all court costs, fees, and surcharges, including victim/witness surcharge, to be paid from 25% of prison funds, balance paid during Extended Supervision if revoked, failure to pay results in a civil judgment;

Court advised defendant that as a convicted felon he may never possess a firearm.  Court advised defendant that his voting rights are suspended, and may not vote in any election until his civil rights are restored.

Appeal rights given. 
Filed: Pretrial Sentence Credit, Notice of Right to Seek Post-Conviction Relief, Ineligible Voting Notice and Acknowledgement, Written Explanation of Determinate Sentence.
